// import logo from './logo.svg';
import './App.css';
import Dashboard from './components/Dashboard';
import Login from './components/Login';
import { Router, Switch, Route, Routes } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/">
            <Login/>
          </Route>
          <Route path="/dashboard">
            <Dashboard/>
          </Route>
        </Routes>

      </div>
    </Router>

  );
}

export default App;
